import logo from './logo.svg';
import { BrowserRouter } from 'react-router-dom';
import Routing from './components/routes';

export function callAPI(request) {
  fetch(request)
      .then(res => res.text())
      .then(res => this.setState({apiResponse: res}))
      .catch(err => err)
      return this.state;
}

/*
